import React from 'react';
import './App.css';
import HeroHeader from './components/HeroHeader';
import NavigationBar from './components/NavigationBar'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HeroHeader></HeroHeader>
        <NavigationBar></NavigationBar>
      </header>
    </div>
  );
}

export default App;
